import React, { Component } from "react";
import PropTypes from "prop-types";
import "styles/tailwind.css";

class Index extends Component {
  render() {
    return (
      <div class="flex flex-wrap">
        <div class="w-full sm:w-1/2 md:w-1/3 lg:w-1/4 xl:w-1/6 my-4 h-12 bg-gray-500"></div>
        <div class="w-full sm:w-1/2 md:w-1/3 lg:w-1/4 xl:w-1/6 my-4 h-12 bg-gray-400"></div>
        <div class="w-full sm:w-1/2 md:w-1/3 lg:w-1/4 xl:w-1/6 my-4 h-12 bg-gray-500"></div>
        <div class="w-full sm:w-1/2 md:w-1/3 lg:w-1/4 xl:w-1/6 my-4 h-12 bg-gray-400"></div>
        <div class="w-full sm:w-1/2 md:w-1/3 lg:w-1/2 xl:w-1/6 my-4 h-12 bg-gray-500"></div>
        <div class="w-full sm:w-1/2 md:w-1/3 lg:w-1/2 xl:w-1/6 my-4 h-12 bg-gray-400"></div>
      </div>
    );
  }
}

Index.propTypes = {};

export default Index;
